import React from 'react'
import axios from 'axios';

class Sender extends React.Component {
    constructor(props) {
        super(props);

        const request = {
            body: "123",
            text: "321"
        };

        axios.post('http://localhost:5000/notes', request).then(res => {
            console.log(res.data);
        })

    }
}

export default Sender;
